import React, { useEffect } from 'react'
import { ArrowLeft } from 'react-bootstrap-icons'
import { Link } from 'react-router-dom'
import GallerySpace from '../Utilities/GallerySpace'
import Footer from './Footer'
import Event from '../Utilities/Event'

function Gallery() {
  useEffect(() => {
    window.scrollTo(0, 0);
  }, []);

  return (
    <div className=''>
      <div className='w-screen h-16 bg-white fixed p-4 opacity-100 z-10'>
            <Link to={'/homepage'} className='z-10'><ArrowLeft className='w-8 h-8'/></Link>
        </div>
        <Event bigImage="images/Carousel_Images/16_team_photos/PXP-9969.jpg" title={"God's Vineyard Gospel Tornament"} eventPath={"/tournament"}/>
      <div>
        <Event bigImage="../Utilities/ImageDirectories/Gods_Alternative_to_Bloodshed_2013.json" title={"God's Alternative to Bloodshed in Nigeria"} eventPath={"/GodsAlternativetoBloodshed"}/>
      </div>
    </div>
  )
}

export default Gallery
